import React from "react"

function Title ({name,title}) {
    return (

        <div className="row">
          <div className="col-4  my-2 text-title ">
          <div style={{ height: 90 }}>
          <h1 className="text-capitalize font-weight-bold">
          {name} 
          <strong className="text-white ">{title}</strong>
          </h1>
          </div>
        </div>
      </div>

    )
  }


export default Title
